          "title": "Starship Flight Test",
          "description": "SpaceX is targeting as soon as Monday, April 17 at 8:00 a.m. CT for the first flight test of a fully integrated Starship and Super Heavy rocket from Starbase in Texas. \n\nStarship is a fully reusable transportation system designed to carry both crew and cargo to Earth orbit, help humanity return to the Moon and travel to Mars and beyond. With a test such as this, success is measured by how much we can learn, which will inform and improve the probability of success in the future as SpaceX rapidly advances development of Starship. \n\nTo date, the SpaceX team has completed multiple sub-orbital flight tests of Starship‚Äôs upper stage from Starbase, successfully demonstrating an unprecedented approach to controlled flight. These flight tests helped validate the vehicle‚Äôs design, proving Starship can fly through the subsonic phase of entry before re-lighting its engines and flipping itself to a vertical configuration for landing.\n\nIn addition to the testing of Starship‚Äôs upper stage, the team has conducted numerous tests of the Super Heavy rocket, which include the increasingly complex static fires that led to a full-duration 31 Raptor engine test ‚Äì the largest number of simultaneous rocket engine ignitions in history. The team has also constructed the world‚Äôs tallest rocket launch and catch tower. At 146 meters, or nearly 500 feet tall, the launch and catch tower is designed to support vehicle integration, launch, and catch of the Super Heavy rocket booster. For the first flight test, the team will not attempt a vertical landing of Starship or a catch of the Super Heavy booster.\n\nA live webcast of the flight test will begin ~45 minutes before liftoff. As is the case with all developmental testing, this schedule is dynamic and likely to change, so be sure to stay tuned to our social media channels for updates."
